import { Button } from 'antd';
import LINK from 'next/link';
import Router from 'next/router';

export default () => (
  <div>
    <LINK href="/a">
      <Button>to A</Button>
    </LINK>
    <Button onClick={() => { Router.push('test/b'); }}>to test/b</Button>
  </div>
);
